- input: "TEXT\x1CC00086348\x1C.TEXT\x1C\x1CF3XA\x1CIn early December 2007 our past
    Treasuer notified us that he was very ill and must resign.  We appointed a new
    Treasurer and then had an extensive audit done to ensure the fund amounts were
    correct.  After the audit we found that some sloppy record keeping had led to
    several duplicate entries for funds received and several checks had not been cleared
    properly.  We conferred with our PAC Analyst at the FEC, Mr. Christopher Morris
    who directed we make the corrections in the year 2007 End of Year report.  One
    Administrative Disbursement for the amount of $32.815.35 was made and one Administrative
    Receipt for the amount of $40 was made.  This brought the Cash on Hand at the
    end of 2007 to $82,540.98 which agrees with the amount of Cash on Hand on January
    1, 2008."
